import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LeaveRequestManager from './components/LeaveRequestManager';
import Navbar from './components/Navbar'; // Sigurohuni që të keni këtë komponent të krijuar

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/leave-requests" element={<LeaveRequestManager />} />
        {/* Mund të shtoni më shumë rruge për faqet tjera */}
      </Routes>
    </Router>
  );
}

export default App;
